import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
  grid: {
    height: "100vh",
    display: "flex",
    flexDirection: "row",
    background: "white",
  },
  sidebar: {
    height: "100vh",
    width: "80vw",
  },
  mainContent: {
    width: "90vw",
  },
}));
